import React, {FC} from 'react';
import '../styles/grid.css';

interface Props {
    key: string;
    data?: string[];
}

const Grid:FC<Props> = (props) => {
    return (
        <>
            <div className="Grid-view" key={props.key}>
                <div className="Grid-desc">
                    <p>a test</p>
                    <p>another one</p>
                </div>
            </div>
        </>
    );
}

export default Grid;
